import React from "react";
import { connect } from "react-redux";

const ImagesList = ({ proccess }) => (

    <div>
    {proccess.uploadImage.showAlertMessage ?   <div className="alert alert-danger" role="alert">{proccess.uploadImage.alertMessage}</div> : null}

    </div>
        
    
)

const mapStateToProps = (state) => {
    return {
        proccess : state.uploadImage.alertMessage 
    }
}


export default connect(mapStateToProps)(ImagesList);
